import React, { Component } from 'react'
import Slider from 'react-slick'
export default class Carousel extends Component {
    render() {
        const settings = {
            dots: true,
            fade: true,
            infinite: true,
            speed: 500,
            slidesToShow: 1,
            arrows: true,
            slidesToScroll:1,
            classname: 'slides'
        }
        return (
            <div>
                <Slider {...settings}>
                {Object.keys(this.props.images).map((key)=>{
                    return <img src = {this.props.images[key]}></img>
                })
                }
                </Slider>
            </div>
        )
    }
}
